import React from 'react';
import Login from './components/Login';
import Main from './components/Main';
import './App.css';

class App extends React.Component {

  state = {
    username: ''
  }

  render() {
    return (
      <div className='App'>
        {this.state.username === '' ? <Login /> : <Main />}
      </div>
    )
  }

}

export default App;
